@app.route("/add_endgame_report", methods=["POST"])
def add_endgame_report():
	print(request.args)
	data = eval(request.args.get('data'))
	my_data = PlayerData(
		player=float(data['player']),
		data=data['data'],
		time=str(datetime.datetime.now()).rstrip("\n")
	)
	db.session.add(my_data)
	db.session.commit()
	return "done"

